import React, {Component} from 'react';
import Header from "./components/Header/Header"
import './App.css';

class App extends Component {
  state = {
    loggedIn: true
  };

  render(){
    return( 
      <div className="App">
       <Header />
      </div>
    )};
}

export default App;
